<script>
    let { focus_skill = $bindable() } = $props();
    
    import { onMount, onDestroy } from 'svelte';

    let changes = [];

    onMount(() => {
        const targetNode = document.getElementById('watchedElement');

        const observer = new MutationObserver((mutationsList) => {
            for (const mutation of mutationsList) {
                changes = [...changes, mutation];
                if (mutation.addedNodes[0]) {
                    focus_skill = mutation.addedNodes[0].data; // 이걸로 focus 제어하기!!!!!!!!!!!!!!
                    console.log('Detected Mutation:', mutation);
                } else {
                    console.log('디테일화면 취소, mutation:', mutation);
                    focus_skill = null;

                }
            }
        });

        observer.observe(targetNode, {
            attributes: true,
            childList: true,
            subtree: true,
            characterData: true
        });

        // Clean up observer when component is destroyed
        return () => observer.disconnect();
    });

</script>

<div id="watchedElement" style="display:none">{focus_skill}</div>

<style>
    /* SVG MAP */
    #svgCanvas {
        width: 100vw;
        height: 100vh;
        border: none;
        /* cursor: none; */
        transition: transform 0.5s ease; /* 애니메이션 속도 변경 */
    }

    #svgCanvas div {
        user-select: none;
    }

    /* svg 표기 시, viewBox 밖에 있는 요소가 있을 경우 표시하지 않는 것때문에 작성 
    -> foreignObject는 화면 밖에 있지만, 내부의 div 요소가 화면 안에 있기 때문에 사라지는 문제 해결 */
    #svgCanvas foreignObject {
        width: 1000% !important;
        height: 1000% !important;
    }

    /* 모바일 스타일 */
    @media (max-width: 768px) {
        /* tree 화면 조정 */
    }
</style>

